import React from "react";
import { useSelector } from "react-redux";
import "./dogDetails.css";

const DogDetails = ({ match }) => {
  const { id } = match.params;
  const dog = useSelector((state) => state.dogs.find((dog) => dog.id === id));

  if (!dog) {
    return <div>No se encontr√≥ la raza de perro especificada</div>;
  }

  return (
    <div className="dog-details">
      <h1>{dog.name}</h1>
      <div className="details">
        <img src={dog.image} alt={dog.name} />
        <div className="info">
          <p>
            <span>Raza: </span>
            {dog.breed}
          </p>
          <p>
            <span>Altura: </span>
            {dog.height}
          </p>
          <p>
            <span>Peso: </span>
            {dog.weight}
          </p>
          <p>
            <span>Esperanza de vida: </span>
            {dog.lifeSpan}
          </p>
          <p>
            <span>Origen: </span>
            {dog.origin}
          </p>
        </div>
      </div>
      <p className="description">{dog.description}</p>
    </div>
  );
};

export default DogDetails;
